# Training using various classifiers
validation_size = 0.20
seed = 7
X_train, X_validation, Y_train, Y_validation = model_selection.train_test_split(X_scaled, Y, test_size = validation_size, random_state=seed)

scoring = 'accuracy'
models = []
# models.append(('KNN', KNeighborsClassifier(n_neighbors=99, metric="euclidean")))
