#                      solver='sgd', verbose=10,  random_state=21,tol=0.000000001)))
results = []
names1 = []
for name, model in models:
    print(model)
    kfold = model_selection.KFold(n_splits=10, random_state=seed)
    cv_results = model_selection.cross_val_score(model, X_train, Y_train, cv=kfold, scoring=scoring)
    results.append(cv_results)
    names1.append(name)
    msg = "%s: %f (%f)" % (name, cv_results.mean(), cv_results.std())
    print(msg)

knn = KNeighborsClassifier(n_neighbors=99, metric="euclidean")
knn.fit(X_train, Y_train)
joblib.dump(knn, 'knn.sav')
predictions = knn.predict(X_validation)
print("KNeighborsClassifier")
print(accuracy_score(Y_validation, predictions))
print(confusion_matrix(Y_validation, predictions))
print(classification_report(Y_validation, predictions))

decisionTree = DecisionTreeClassifier()
decisionTree.fit(X_train, Y_train)
joblib.dump(decisionTree, 'decision_tree.sav')
predictions = decisionTree.predict(X_validation)
print("DecisionTree")
print(accuracy_score(Y_validation, predictions))
print(confusion_matrix(Y_validation, predictions))
print(classification_report(Y_validation, predictions))

randomForest = RandomForestClassifier(n_estimators=100)
randomForest.fit(X_train, Y_train)
predictions = randomForest.predict(X_validation)
joblib.dump(randomForest, 'random_forest.sav')
print("RandomForest")
print(accuracy_score(Y_validation, predictions))
print(confusion_matrix(Y_validation, predictions))
print(classification_report(Y_validation, predictions))

